import React, { Component } from "react";
import {
  Card,
  CardImg,
  CardText,
  CardBody,
  CardTitle,
  CardSubtitle,
  Button
} from "reactstrap";

export class Featured extends Component {
  render() {
    return (
      <div>
        <Card>
          <CardImg
            top
            width="10%"
            src="http://speakableslp.com/wp-content/uploads/2015/08/logo5.png"
            alt="Card image cap"
          />
          <CardBody>
            <CardTitle>SpeakableSLP</CardTitle>
            <CardSubtitle>Card subtitle</CardSubtitle>
            <CardText>
              Providing top quality in-home assessment and therapy services to
              individuals of all ages in Montreal and Toronto
            </CardText>
            <a>Button</a>
          </CardBody>
        </Card>
      </div>
    );
  }
}

export default Featured;
